import React from "react";
import { Form } from "antd";

const LoginForm = () => {
  return (
    <Form>
      <div>
        <label htmlFor="">아이디</label>
      </div>
      <div></div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default LoginForm;
